import styled from 'styled-components'

export const StarRatingContainer = styled.div`
  padding-left: 1rem;
  display: inline-flex;
  align-items: center;
  cursor: pointer;

  svg {
    width: 1.4rem;
    margin-right: 4px;
    padding: 0.5rem;
  }
`
